                <h2 className = 'card-name'>{props.player.name}</h2>
                <h2 className = 'card-team' >{props.player.team}</h2>
                <h2 className = 'card-rank'>World Ranking : {props.player.rank}</h2>
            </div>
        </div>
    )
}


export default PlayerCard
